% dimensions of the lattices

nx = 6;
ny = 6;
nz = 6;

% number of atoms

natm = 4;

% harmonic force constant i,j,tau,alpha,beta

fc = zeros(3,3,natm,natm,nx,ny,nz);

iline = 1;
for i = 1:(natm*3)^2
    
    % Cartesian coordinates
    alpha = data(iline,1);
    beta  = data(iline,2);
    
    % basis
    iatm  = data(iline,3);
    jatm  = data(iline,4);
    
    iline = iline + 1;
    
    for j = 1:nx*ny*nz 
        fc(alpha,beta,iatm,jatm,data(iline,1),data(iline,2),data(iline,3)) = data(iline,4);       
        iline = iline + 1;
    end
    
end

% acoustic sum rule

for i = 1:3
    for j = 1:3
        for iatm = 1:natm
            fc(i,j,iatm,iatm,1,1,1) = -sum(reshape(fc(i,j,iatm,:,:,:),[],1))...
                +fc(i,j,iatm,iatm,1,1,1);
        end
    end
end


